            <h1 id="telebotkit">TeleBotKit</h1>
<blockquote>
<p>一个电报(Telegram)机器人框架
双卡双待，支持普通账号登录与机器人账号登录<br>
多账号，框架可以多开登录，也可以在一个框架内登录多个账号<br>
支持二次开发，基于事件推送的插件系统<br>
